import { useState } from 'react'


const Tasks = () => {
    const [tasks, setTasks] = useState([
    {
        id: 1,
        text: 'Doctor Appnt',
        day: 'feb friday ',
        reminder: 'true',

    },
    {
        id: 2,
        text: 'Doctor Appnt2',
        day: 'feb sunday ',
        reminder: 'true',

    },
    {
        id: 3,
        text: 'Doctor Abkono',
        day: 'feb friday ',
        reminder: 'false',

    }
])
    return (
        <>
            {
                tasks.map((task) => (<h3 key={task.id}>{task.text}</h3>))
            }  
        </>
    )
}

export default Tasks
